import React, { useState, useRef } from "react";
import VoiceControl from "./VoiceControl";

export default function App() {
  const [transcript, setTranscript] = useState("");
  const [manualPrompt, setManualPrompt] = useState("");
  const [generatedCode, setGeneratedCode] = useState("Your code will appear here.");
  const [isRecording, setIsRecording] = useState(false);

  const compileOutputRef = useRef("");

  // Handlers triggered by voice commands:
  const startRecording = () => {
    setTranscript("");
    setIsRecording(true);
  };

  const stopRecording = () => {
    setIsRecording(false);
  };

  const generateCode = async () => {
    const prompt = manualPrompt.trim() || transcript.trim();
    if (!prompt) return alert("Please provide a prompt to generate code.");

    try {
      const res = await fetch("http://localhost:5000/api/generate-code", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ prompt }),
      });
      const data = await res.json();
      setGeneratedCode(data.code);
    } catch (err) {
      alert("Failed to generate code: " + err.message);
    }
  };

  const compileCode = async () => {
    try {
      const res = await fetch("http://localhost:5000/api/compile", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ code: generatedCode }),
      });
      const data = await res.json();
      compileOutputRef.current = data.output;
      alert("Compilation Output:\n" + data.output);
    } catch (err) {
      alert("Failed to compile code: " + err.message);
    }
  };

  const saveCode = () => {
    // Save generated code as a file
    const blob = new Blob([generatedCode], { type: "text/plain" });
    const url = URL.createObjectURL(blob);
    const a = document.createElement("a");
    a.href = url;
    a.download = "codevoice_output.py";
    a.click();
    URL.revokeObjectURL(url);
    alert("Code saved as codevoice_output.py");
  };

  return (
    <div style={{ maxWidth: 600, margin: "auto", padding: 20, fontFamily: "Arial, sans-serif" }}>
      <button
        style={{
          backgroundColor: "#1e40af",
          color: "white",
          padding: "8px 16px",
          borderRadius: 5,
          border: "none",
          cursor: "pointer",
          marginBottom: 10,
        }}
        onClick={() => (isRecording ? stopRecording() : startRecording())}
      >
        {isRecording ? "Stop Recording" : "Start Recording"}
      </button>

      <div style={{ marginBottom: 15 }}>
        <label style={{ fontWeight: "bold" }}>Transcript:</label>
        <textarea
          rows={4}
          value={transcript}
          readOnly
          style={{ width: "100%", resize: "none", marginTop: 5, padding: 5 }}
        />
      </div>

      <div style={{ marginBottom: 15 }}>
        <label style={{ fontWeight: "bold" }}>Or Enter Prompt Manually:</label>
        <textarea
          placeholder="Type your prompt if mic does not work..."
          rows={3}
          value={manualPrompt}
          onChange={(e) => setManualPrompt(e.target.value)}
          style={{ width: "100%", resize: "none", marginTop: 5, padding: 5 }}
        />
      </div>

      <button
        onClick={generateCode}
        style={{
          backgroundColor: "#16a34a",
          color: "white",
          fontWeight: "bold",
          padding: "8px 16px",
          borderRadius: 5,
          border: "none",
          cursor: "pointer",
          marginBottom: 15,
          width: "100%",
        }}
      >
        âš¡ Generate Code
      </button>

      <div style={{ marginBottom: 15 }}>
        <label style={{ fontWeight: "bold" }}>Generated Code:</label>
        <pre
          style={{
            backgroundColor: "#f3f4f6",
            borderRadius: 5,
            minHeight: 150,
            padding: 10,
            whiteSpace: "pre-wrap",
            overflowX: "auto",
          }}
        >
          {generatedCode}
        </pre>
      </div>

      <VoiceControl
        isRecording={isRecording}
        onTranscriptChange={setTranscript}
        onStartRecording={startRecording}
        onStopRecording={stopRecording}
        onGenerateCode={generateCode}
        onCompileCode={compileCode}
        onSaveCode={saveCode}
      />
    </div>
  );
}
